-- Create a frame
local frame = CreateFrame("Frame", "Good Name Pending WA Installer", UIParent, "BasicFrameTemplateWithInset")
frame:SetSize(750, 600) -- Width, Height
frame:SetPoint("CENTER") -- Position it in the center
frame:Hide()

-- Add a background to the frame
local frameBg = frame:CreateTexture(nil, "BACKGROUND")
frameBg:SetAllPoints(frame)
frameBg:SetColorTexture(0, 0, 0, 0.5) -- Black background with transparency

-- Enable dragging for the frame
frame:SetMovable(true)
frame:EnableMouse(true)
frame:RegisterForDrag("LeftButton")
frame:SetScript("OnDragStart", frame.StartMoving)
frame:SetScript("OnDragStop", frame.StopMovingOrSizing)

frame.title = frame:CreateFontString(nil, "OVERLAY")
frame.title:SetFontObject("GameFontHighlight")
frame.title:SetPoint("TOP", frame.TitleBg, "CENTER", 115, 6)
frame.title:SetText("GNP Weak Aura Installer")

-- Create the sidebar menu
local menuWidth = 200
local menu = CreateFrame("Frame", "MyMenuFrame", frame)
menu:SetSize(menuWidth, frame:GetHeight() - 0) -- Sidebar width and height
menu:SetPoint("LEFT", frame, "LEFT", 0, 0) -- Position it within the frame

-- Add a background to the menu
local menuBg = menu:CreateTexture(nil, "BACKGROUND")
menuBg:SetAllPoints(menu)
menuBg:SetColorTexture(0, 0, 0, 0.75) -- Black background with transparency

-- Create content frames
local contentFrames = {}
local contentNames = {"Home Content", "Nerub-ar Palace Content"}

for i, contentName in ipairs(contentNames) do
    local contentFrame = CreateFrame("Frame", nil, frame)
    contentFrame:SetSize(frame:GetWidth() - menuWidth - 10, frame:GetHeight()) -- Size of content area
    contentFrame:SetPoint("TOPLEFT", menu, "TOPRIGHT", 0, 0) -- Position content area to the right of the menu
    contentFrame:Hide()
    contentFrames[i] = contentFrame

    -- Add content to the frame
    if contentName == "Nerub-ar Palace Content" then
        local headingText = contentFrame:CreateFontString(nil, "OVERLAY", "GameFontNormalLarge")
        headingText:SetPoint("CENTER", contentFrame, "CENTER", 0, 260)
        headingText:SetText("Nerub-ar Palace Required WA's")

        local yOffset = -120
        for auraName, auraString in pairs(GNPWAInstaller.auras) do
            local button = CreateFrame("Button", nil, contentFrame, "GameMenuButtonTemplate")
            button:SetPoint("TOP", contentFrame, "TOP", 0, yOffset)
            button:SetSize(400, 30)
            button:SetText(auraName)
            button:GetFontString():SetTextColor(255, 190, 0)

            local highlightTexture = button:CreateTexture()
            highlightTexture:SetTexture("Interface\\Buttons\\UI-SilverButtonLG-Mid-Up")
            highlightTexture:SetTexCoord(0, 0.625, 0, 0.6875)

            button:SetHighlightTexture(highlightTexture)

            button:SetScript(
                "OnClick",
                function()
                    if WeakAuras then
                        WeakAuras.Import(auraString)
                        print("WeakAura installed successfully!")
                    else
                        print("WeakAuras addon not found!")
                    end
                end
            )
            yOffset = yOffset - 40
        end
    elseif contentName == "Home Content" then
        -- Example home content
        local homeText = contentFrame:CreateFontString(nil, "OVERLAY", "GameFontNormalLarge")
        homeText:SetPoint("CENTER")
        homeText:SetText("Install the correct weakauras you fucks.")

        -- Add a logo texture to the frame
        local logo = contentFrame:CreateTexture(nil, "BACKGROUND")
        logo:SetSize(250, 250) -- Width, Height
        logo:SetPoint("TOP", contentFrame, "TOP", 0, -65) -- Position it at the top of the frame
        logo:SetTexture("Interface\\AddOns\\GoodNamePending\\media\\logo_gnp_blue.png")
    end
end

-- Function to show content based on menu button
local function ShowContent(index)
    for i, contentFrame in ipairs(contentFrames) do
        if i == index then
            contentFrame:Show()
        else
            contentFrame:Hide()
        end
    end
end

-- Create menu buttons
local menuButtons = {}
local menuNames = {"Home", "Nerub-ar Palace"}
local buttonHeight = 30
local buttonSpacing = 0

for i, buttonName in ipairs(menuNames) do

    local button = CreateFrame("Button", nil, menu, "GameMenuButtonTemplate")
    button:SetPoint("TOP", menu, "TOP", 0, -((i - 1) * (buttonHeight + buttonSpacing)))
    button:SetSize(menuWidth - 10, buttonHeight)
    button:SetText(buttonName)
    button:GetFontString():SetTextColor(255, 190, 0)

    local highlightTexture = button:CreateTexture()
    highlightTexture:SetTexture("Interface\\Buttons\\UI-SilverButtonLG-Mid-Up")
    highlightTexture:SetTexCoord(0, 0.625, 0, 0.6875)

    button:SetHighlightTexture(highlightTexture)

    button:SetScript(
        "OnClick",
        function()
            ShowContent(i)
        end
    )
    menuButtons[i] = button
end

-- Default to showing the first content
ShowContent(1)

-- Function to toggle the frame visibility
local function ToggleFrame()
    if frame:IsVisible() then
        frame:Hide()
    else
        frame:Show()
    end
end

-- Register the slash command
SLASH_GNPWAINSTALLER1 = "/gnp"
SlashCmdList["GNPWAINSTALLER"] = ToggleFrame

-- Event handling
frame:RegisterEvent("ADDON_LOADED")
frame:SetScript(
